let cur = null;

function connect() {
    ws = new WebSocket('wss://' + self.location.hostname + '/ws');

    ws.onopen = () => {
        document.getElementById('status').textContent = 'Connected';
        document.getElementById('status').className = 'status connected';
        document.getElementById('input-res').textContent = 'None';
        document.getElementById('dynamic-image').className = 'game-image';
    };

    ws.onmessage = async (message) => {
        if (typeof message.data === "string" && message.data.trim() === 'false') {
            document.getElementById('input-res').textContent = 'Incorrect, Start Over Diver!';
            document.getElementById('input-res').className = 'input-result incorrect';
            document.getElementById('dynamic-image').className = 'game-image incorrect';

            i = 0;
            di = (di + 1) % directions.length;
            if (l !== null) {
                bruteforce();
            }
        } else if (typeof message.data === "string" && message.data.trim() === 'true') {
            document.getElementById('input-res').textContent = 'Correct';
            document.getElementById('input-res').className = 'input-result correct';
            document.getElementById('dynamic-image').className = 'game-image correct';

            if (guess) {
                if (i >= l.length) {
                    l.push(directions[di]);
                    di = 0;
                }
                i += 1;
                if (l !== null) {
                    bruteforce();
                }
            }
        } else if (typeof message.data === "string" && message.data.trim() === 'Times Up!') {
            console.log("MESSAGE", message.data);
            console.log('Times Up!');
            document.getElementById('input-res').textContent = 'Times Up! Gotta be faster than that Diver!';
            document.getElementById('input-res').className = 'input-result timesup';
            document.getElementById('dynamic-image').className = 'game-image timesup';
        } else if (typeof message.data === "string" && message.data.trim() !== 'true' && message.data.trim() !== 'false' && message.data.trim() !== 'Times Up!') {
            document.getElementById('score').textContent = message.data;
        } else if (typeof message.data === "object") {
            const imgElement = document.getElementById('dynamic-image');
            const base64img = await convertBlobToBase64(message.data);
            imgElement.src = 'data:image/webp;base64,' + base64img;

            if (!(cur in d)) {
                d[cur] = [...l];
            }
            cur = imgElement.src;

            l = null;
            i = 0;
            di = 0;

            setTimeout(() => {
                l = [];
                bruteforce();
            }, t);
        }
    };

    ws.onclose = () => {
        document.getElementById('status').textContent = 'Disconnected';
        document.getElementById('status').className = 'status disconnected';
        console.log('Disconnected');
        // Attempt to reconnect in 2 seconds
        setTimeout(connect, 2000);
    };
}

function sendMessage(command) {
    ws.send(JSON.stringify({command}));
}

connect();

function convertBlobToBase64(blob) {
    return new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.onloadend = () => resolve(reader.result.split(',')[1]); // Extract Base64 from data URL
        reader.onerror = reject;
        reader.readAsDataURL(blob); // Read as Data URL
    });
}

const directions = ['left', 'up', 'right', 'down'];
const t = 10; // Timeout used to avoid race conditions
let l = [];
let i = 0;
let di = 0;
let guess = true;  // Indicates if a new guess should be made. Used to avoid race conditions
let con = true;  // Used to stop the brute force

function bruteforce() {
    // Setting con = false in the console allows us to stop the brute force at any time
    if (con) {
        if (cur in d) {
            l = null;
            guess = false;
            for (const x of d[cur]) {
                sendMessage(x);
            }
            return;
        }

        guess = true;
        if (i < l.length) {
            sendMessage(l[i]);
        } else {
            sendMessage(directions[di]);
        }
    }
}

